import { Link } from "react-router-dom";

function PlayerLineUp(props) {
    const player = props.player
    return (
        <Link to={"/player/" + (player?.id)}>
            <div className="flex flex-col items-center">
                <div className="h-9 w-9 bg-gray-100 rounded-full flex items-end justify-center relative">
                    {player.rating.num && 
                        <div style={{backgroundColor: `${player.rating.bgcolor}`}} className="hidden md:flex px-2 py-0.5 absolute -top-2 -end-0 text-xs items-center justify-end rounded-full">
                            {player.rating.num}
                        </div>
                    }
                    <div className="overflow-hidden">
                    <img className="h-8" alt="playerPhoto" src={`https://images.fotmob.com/image_resources/playerimages/${player?.id}.png`}></img>
                    </div>
                </div>
                <div className="text-sm text-gray-100 text-center">
                    <span className="font-medium">{player?.shirt}</span> {player?.name?.lastName}
                </div>
            </div>
        </Link>
    )
}

export default PlayerLineUp
